import React, {useState, useEffect} from 'react'

export default function Test() {
    const [textPromptback, setPromptback] = useState("hello");
    useEffect(
    () =>
      fetch("/api")
        .then((response) => response.json())
        .then((data) => {
          setPromptback(data.prompt);
        }),
    []
  );

  return (
    <div> 
        {textPromptback}
    </div>
  )
}
